import React from 'react';
import ReactDOM from 'react-dom';
import Comment from './Comment'

const App = ()=>{
    return(
        <div className='ui container comments'>
            <Comment name='Kaniah' post='awesome post!!' time='2:30PM'/>
            <Comment name='Maria' post='Great Tips' time='5:30PM'/>
            <Comment name='Ivy' post='These are very helpful!' time='6:00PM'/>
            <Comment name='Tim' post='WWOOOOWWWW' time='8:45PM'/>
        </div>
    ) 
}

ReactDOM.render(
    <App/>, document.querySelector('#root')
)
